   All it takes to bring him down is one bullet... one woman or... One False Move.



After an &quot;LA drugs deal&quot; leads to blood and carnage, the perpetrators end up in small town Arkansas where the leader Ray contacts his ex-girlfriend. Two LA Detectives ensue and soon find themselves out of sorts away from the big city. Chief Dale 'Hurricane' Dixon sees his chance to impress and get dream a move to the big city but his hicksville approach leads to mockery and derision. Keeping important information from the two officers he tries to play clever and capture the criminals himself. 'Classic' neo-noir with a simple good will beat bad but watch for nasty message.
